  `loadCPU` double NOT NULL,
  `modelCPU` varchar(191) NOT NULL,
  `received` bigint(20) NOT NULL,
  `sent` bigint(20) NOT NULL,
  `speed` double NOT NULL,
  `date` datetime(3) NOT NULL,
